	  303557,"26/1985",18732,130,1985,
	  "220 DEM",32.000,NULL,"Dies ist die letzte Ausgabe der Superman Hefte im Ehapa Verlag Deutschland. 20 Jahre und 497 Ausgaben seit erscheinen des ersten Heftes. Es gibt absolut keinen Kommentar der Redaktion auf das Ende. Nur das Fehlen des Hinweises auf die nächste Ausgabe auf der Rückseite lässt darauf schließen das es kein weiteres Heft geben könnte. Die Superman Superbände und die Taschenbücher liefen noch zwei Jahre länger. 1987/88 versuchten sie es noch mit überformatigen Heften doch nach 12 Ausgaben war wieder Schluß. Danach versuchten weitere Verlage (Feest Hethke Carlsen) ihr Glück doch erst 1995 schaffte es der Dino-Verlag wieder eine monatliche Heftserie zu etablieren.",
